    false,nt"url": null,nt"notes": "The Series and Class Report provides basic
    identification information for all active registered investment company series and
    classes that have been issued IDs by the Commission.  Beginning on February 6, 2006,
    all open-end mutual funds (Form N-1A filers), insurance separate accounts organized
    as mutual funds (Form N-3 filers), insurance separate accounts organized as unit
    investment trusts (Form N-4 and Form N-6 filers).  Investment companies (see adopting
    release http://www.sec.gov/rules/final/33-8590.pdf) have been required to use these
    IDs when making their electronic filings with the Commission. Since February 6,
    2006,  series and class IDs have also been issued to a few closed-end funds (Form
    N-2 filers) and unit investment trusts that are not used to fund separate accounts
    (S-6 filers).",nt"license_title": null,nt"extras": [{ntt"key": "data-quality",ntt"value":
